import React from "react";
import "./foodcont.css";
import FoodBox from "./FoodBox2";
import PaymentSect from "./PaymentSect";
import { Link } from "react-router-dom";

import plan0 from "../img/plan_BMC_R0.jpg";
import plan1 from "../img/plan_BMC_R1.jpg";
import plan2 from "../img/plan_BMC_R2.jpg";

function BIB1() {

    return (
        <>
            <div className="foodcontainer">
                <div className="left-side">
                    <div className="cards">

                        <main>
                            <FoodBox imgSrc={plan0} title={"BMC"} price={"38"} product={"coffe"}/>
                            <FoodBox imgSrc={plan1} title={"Etage 1"} price={"89"}/>
                            <FoodBox imgSrc={plan1} title={"Etage 2"} price={"89"}/>

                        </main>

                    </div>
                </div>
                <div className="right-side">
                    <PaymentSect />
                </div>
            </div>
        </>
    );
}

export default BIB1;
